/*
 * @Author: your name
 * @Date: 2022-04-11 16:11:20
 * @LastEditTime: 2022-04-11 19:37:25
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage-test\src\layouts\FlowManage\index.js
 */
import React from "react";
import ReactDOM from "react-dom";
import GGEditor, { Flow, EditableLabel } from "gg-editor";

import "./style.css";

const data = {
  nodes: [
    {
      id: "0",
      label: "Node",
      x: 55,
      y: 55
    },
    {
      id: "1",
      label: "Node",
      x: 55,
      y: 255
    }
  ],
  edges: [
    {
      label: "Label",
      source: "0",
      target: "1"
    }
  ]
};

function App() {
  return (
    <GGEditor className="editor">
      <Flow
        className="editorBd"
        data={data}
        graphConfig={{
          defaultNode: {
            shape: "bizFlowNode"
          },
          defaultEdge: {
            shape: "bizFlowEdge"
          }
        }}
      />
      <EditableLabel />
    </GGEditor>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
